INSERT INTO `Elemento` VALUES (1,'ACT','1','Líder de análisis','Es el analista encargado de un proyecto.',5,1),(2,'ACT','2','Analista','Es el encargado de documentar los elementos que componen el proyecto.',5,1),(3,'ACT','3','Administrador','Es la persona encargada de registrar los proyectos y al personal de la organización.',5,1),(4,'ENT','1','Elemento','Esta entidad engloba a varias otras entidades, es una generalización de caso de uso, pantalla, mensaje, regla de negocio, término del glosario, actor y entidad.',5,1),(5,'ENT','2','Actor','Se refiere a los roles de los usuarios en el sistema.',5,1),(6,'GLS','1','Cardinalidad','Es el número de actores que participarán o serán requeridos en el sistema.',5,1),(7,'RN','12','Identificador de elemento','El identificador de cada elemento se compone de un nombre, número y una clave. \n	Donde el nombre es el que le asigna el usuario, el número es secuencial y la clave define el tipo de elemento: \"ENT\" para las entidades, \"ACT\"\" para los actores, \"CU\" para los casos de uso, \"IU\" para\n    las pantallas, \"MSG\" para los mensajes, \"RN\" para las reglas de negocio y \"GLS\" para los términos del glosario.',5,1),(8,'RN','8','Datos obligatorios','El usuario debe ingresar toda la información marcada como obligatoria en el modelo conceptual.',5,1),(9,'RN','60','Unicidad de nombres de actor','El nombre de los elementos del mismo tipo no puede repetirse.',5,1),(10,'RN','61','Nombre del actor','Los nombres de los elementos no pueden contener coma, punto, punto medio, dos puntos o guión bajo.',5,1),(11,'RN','62','Tipo de dato correcto','La información que el usuario proporcione, debe ser del tipo definido en el modelo conceptual.',5,1),(12,'RN','63','Longitud correcta','La información que el usuario proporcione, debe cumplir con la longitud definida en el modelo conceptual.',5,1),(13,'MSG','1','Operación exitosa','Notificar al actor que la operación se ha realizado de forma exitosa.',5,1),(14,'MSG','4','Dato obligatorio','No