ltados BEST.',1,2),(305,'IUSPR1','1.8','BEST Administration','Permitirá al actor agregar, consultar o editar una evaluación B.E.S.T.',1,2),(306,'IUSPR1','1.9','Edit BEST','Se podrá modificar los resultados de una evaluación BEST.',1,2),(307,'CUSPR1','2.1','Registrar BEST','ermite registrar los resultados del examen B.E.S.T. (Business English Skill Test) de un estudiante. Se podrán ingresar las calificaciones del Listening, Speaking, Reading, Writing,Grammar, Vocubulary y Pronunciation y el sistema calculará el promedio de las calificaciones ingresadas. El examen B.E.S.T. se hace aproximadamente cada tres meses y se debe tener un historial de las calificaciones obtenidas en cada examen.',5,2),(309,'IUSPR1','7.3','Consultar libro','Visualizar los datos del libro seleccionado.',1,2),(310,'CUSPR1','7.3','Consultar libro','Para consultar la información de un libro es necesario oprimir el ícono View del libro que se desee consultar en la pantalla IUL1 Books Administration. Una vez seleccionado el libro, el sistema mostrará la pantalla IUL1.2 Show Book con la información del libro seleccionado.',7,2),(312,'CUSPR1','7.4','Eliminar libro','Para eliminar un libro se debe oprimir el botón eliminar que corresponda al libro deseado en la pantalla IUL1 Books Administration del caso de uso CUL1 Administrar Libros.',7,2),(313,'IUSPR1','9','No Filled Report Administration','Visualizar los grupos y fechas de las sesiones del coach y este podrá llenar el reporte.',1,2),(314,'IUSPR1','9.1','Group Evaluation','Se crea y registra el reporte de evaluación ue un coach tiene que utilizar al final de cada sesión.',1,2),(315,'IUSPR1','9.2','Register Session Evaluation','Registrar las calificaciones de una sesión',1,2),(316,'CUSPR1','2.3','Consultar Evaluación BEST','Permite visualizar los resultados de la evaluación B.E.S.T. (Business English Skill Test) de un alumno. Se mostrarán los porcentajes obtenidos en cada modulo de la evaluación y el promedio obtenido.',1,2),(319,'CUSPR1','4.1','Registrar reporte de la sesión','En cada sesión el coach deberá hacer un reporte de evaluación el cual contendrá información sobre la sesión, el desempeño del grupo y la planidicación de la siguiente sesión.',1,2),(320,'IUSPR1','50','Filled Report Administration','Se podrán visualizar los grupos y fechas de las sesiones del coach y éste podrá editar el reporte.',1,2),(321,'IUSPR1','51','Edit Session Report','Permitirá al actr editar la información registrada de un reporte de sesión.',1,2),(322,'IUSPR1','52','Edit Session Evaluation','Se podrá editar las calificaciones de una sesión.',1,2),(323,'CUSPR1','5','Gestionar Reportes Evaluados','Permite gestionar los reportes y evaluación de la sesión que ya han sido evaluados anteriormente.',1,2),(325,'MSG','71','Formato de año incorrecto','Indicar que la información en el campo año es incorrecta.',1,2),(340,'CUSPR1','1','Iniciar sesión','El inicio de sesión permite a un usuario que ingrese al sistema. Debe tener un correo y una contraseña registrada en el sistema.',7,2),(341,'RN','109','Formato de nombre','Formato para un nombre.',5,2);
