INSERT INTO `ReglaNegocio` VALUES (7,'El identificador de cada elemento se compone de un nombre, número y una clave. \n	Donde el nombre es el que le asigna el usuario, el número es secuencial y la clave define el tipo de elemento: \"ENT\" para las entidades, \"ACT\"\" para los actores, \"CU\" para los casos de uso, \"IU\" para\n    las pantallas, \"MSG\" para los mensajes, \"RN\" para las reglas de negocio y \"GLS\" para los términos del glosario.',10,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(8,'El usuario debe ingresar toda la información marcada como obligatoria en el modelo conceptual.',4,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(9,'El nombre de los elementos del mismo tipo no puede repetirse.',3,4,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(10,'Los nombres de los elementos no pueden contener coma, punto, punto medio, dos puntos o guión bajo.',9,NULL,NULL,NULL,NULL,NULL,NULL,NULL,4,'[^,._·:]*$'),(11,'La información que el usuario proporcione, debe ser del tipo definido en el modelo conceptual.',6,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(12,'La información que el usuario proporcione, debe cumplir con la longitud definida en el modelo conceptual.',5,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(23,'Es necesario que exista información registrada en los catálogos al momento de solicitar una operación que requiera estos.',1,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(49,'La clave CURP del personal debe ser única.',3,11,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(51,'Verifica que el formato del correo electrónico sea correcto.',9,NULL,NULL,NULL,NULL,NULL,NULL,NULL,15,'^[_a-z0-9-]+(.[_a-z0-9-]+)*@[a-z0-9-]+(.[a-z0-9-]+)*(.[a-z]{2,4})$'),(126,'Aquellos datos marcados como obligatorios no se deben omitir.',4,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(127,'Todos los datos proporcionados deben pertenecer al tipo de dato y respetar el formato especificado en el modelo de información.',6,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(128,'Cada dato proporcionado debe cumplir con la longitud definida por la base de datos y el modelo de información.',5,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(129,'Formato PDF',7,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(130,'Tamaño no mayor a 2 MB',8,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(131,'Los números decimales no podrán tener más de dos cifras decimales después del punto.',9,NULL,NULL,NULL,NULL,NULL,NULL,NULL,161,'[0-9]+(\\.[0-9][0-9]?)?'),(208,'Un correo electrónico debe cumplir con la expresión regular.',9,NULL,NULL,NULL,NULL,NULL,NULL,NULL,33,'^[_a-z0-9-]+(.[_a-z0-9-]+)*@[a-z0-9-]+(.[a-z0-9-]+)*(.[a-z]{2,4})$'),(209,'Una URL válida tiene que cumplir con la expresión regular ˆ(https?:\\/\\/)?([\\da-z\\.-]+)\\.([a-z\\.]{2,6})([\\/\\w \\.-]*)*\\/?$',9,NULL,NULL,NULL,NULL,NULL,NULL,NULL,81,'ˆ(https?:\\/\\/)?([\\da-z\\.-]+)\\.([a-z\\.]{2,6})([\\/\\w \\.-]*)*\\/?$'),(210,'Una URL válida tiene que cumplir con la expresión regular ˆ(https?:\\/\\/)?([\\da-z\\.-]+)\\.([a-z\\.]{2,6})([\\/\\w \\.-]*)*\\/?$',9,NULL,NULL,NULL,NULL,NULL,NULL,NULL,83,'ˆ(https?:\\/\\/)?([\\da-z\\.-]+)\\.([a-z\\.]{2,6})([\\/\\w \\.-]*)*\\/?$'),(211,'Una URL válida tiene que cumplir con la expresión regular ˆ(https?:\\/\\/)?([\\da-z\\.-]+)\\.([a-z\\.]{2,6})([\\/\\w \\.-]*)*\\/?$',9,NULL,NULL,NULL,NULL,NULL,NULL,NULL,82,'ˆ(https?:\\/\\/)?([\\da-z\\.-]+)\\.([a-z\\.]{2,6})([\\/\\w \\.-]*)*\\/?$'),(212,'Las imágenes que se manejen en el sistema se considerarán correctas si cumplen con lo siguiente:\r\nFormato PNG, JPG o JPEG.\r\nTamaño no mayor a 3 MB.',10,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(213,'En el campo Year solo se puede introducir caracteres numéricos',9,NULL,NULL,NULL,NULL,NULL,NULL,NULL,63,'^(19|20)\\d\\d$'),(214,'Solo puede haber medios de contacto de emergencia que sean de tipo Mobile o Telephone. Los medios de contacto para emergencias requieren información adicional como parentesco y nombre completo de la persona.',10,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(215,'Dos clientes se consideran la misma persona si el RFC sin homoclave son iguales.',3,156,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(216,'Dos clientes se consideran la misma persona si el correo electrónico son iguales.',3,33,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(218,'Los usuarios del sistema iniciarán sesión con su correco electrónico y una contraseña ingresada al momento de confirmar el correo electrónico. Posteriormente cada usuario podrá cambiar su contraseña o solicitar su recuperación.',10,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(219,'Es necesario que cada Coach tenga registrado al menos un lenguaje que conozca.',10,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(220,'El rango válido para la disponibilidad de un coach es de lunes a domingo de 6 de la mañana a 10 de la noche. Dentro de este horario un grupo puede tomar clases.',10,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(221,'Un coach debe estar disponoble por lo menos 1 hora a la semana.',10,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(222,'Un grupo puede tener a lo más 5 direcciones registradas.',10,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(223,'La fecha de nacimiento no puede ser anterior al año actual menos 120 años, ni puede ser posterior al año actual menos 1 año.',10,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(224,'Un periodo se define con los siguientes atributos:\r\n- Fecha\r\n- Hora de inicio Hi\r\n- Hora final Hf',10,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(225,'La hora final debe ser mayor que la hora inicial.',2,NULL,NULL,NULL,NULL,114,111,2,NULL,''),(226,'Los usuarios se autenticarán con el correo de inicio de sesión. Este correo electrónico no\r\npodrá estar repetido en la sección Methods of Contact.',10,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(227,'Las operaciones disponibles para realizar con el estudiante potencial dependen del estado\r\nen que se encuentre.',10,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(228,'No se puede activar un usuario sin un correo electrónico al menos.',10,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(229,'Las operaciones disponibles para realizar con el coach dependen del estado en que se encuentre:\r\n• Initial: Register Home Address, Register Educational Background, Register Employment Data, Modify Personal Data, Modify Home Address, Modify Educational Background, Modify Employment Data, Activate, Deactivate, View y Delete.\r\n• Inactive: Activate y View.\r\n• Active: Modify Personal Data, Modify Home Address, Modify Educational Background, Modify Employment Data, Deactivate y View.',10,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(230,'No es posible que un usuario tenga dos medios de contacto repetidos. Los medios de\r\ncontacto son únicos de acuerdo a los elementos que los componen:\r\n• Email Address: Email ',3,77,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(231,'No es posible que un usuario tenga dos medios de contacto repetidos. Los medios de\r\ncontacto son únicos de acuerdo a los elementos que los componen:\r\n• Linkedin: URL',3,81,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(232,'No es posible que un usuario tenga dos medios de contacto repetidos. Los medios de\r\ncontacto son únicos de acuerdo a los elementos que los componen:\r\n• Facebook: URL',3,83,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(233,'No es posible que un usuario tenga dos medios de contacto repetidos. Los medios de\r\ncontacto son únicos de acuerdo a los elementos que los componen:\r\n• Twitter: URL',3,82,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(235,'Un correo electrónico no se puede duplicar en todo el sistema ni registrar más de una ocasión, esto incluye el correo de inicio de sesión y los que se encuentran registrados como medios de contacto.',10,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(236,'Los usuario pueden tener como máximo 10 medios de contacto parte del correo de inicio de sesión. Estos medios de contacto pueden ser de cualquier tipo: correo electrónico, teléfono, fax, etcétera.',10,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(237,'Las notificaciones que se tengan que enviar al usuario, se enviarán al correo electrónico de inicio de sesión (considerado como el principal).',10,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(238,'Se considera homonimia si una persona tiene exactamente el mismo nombre completo (first name, middle name, first last name y second last name) y la misma fecha de nacimiento.',10,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(239,'Se permiten registrar casos de hominimia si el correo de inicio de sesión es diferente. Sin embargo, se debe notificar al usuario para evitar posibles registros duplicados.',10,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(240,'El títutlo y el autor de un libro no se puede duplicar en todo el sistema ni registrar más de una ocasión.',3,64,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(241,'El libro no podrá ser eliminado si stá asignado a un curso.',10,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(242,'El subtotal del curso se calcula restando  el porcentaje de descuento  del costo ( Fee) al costo del curso. ',10,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(243,'El total del curso se calcula sumando el porcentaje del I.V.A. del subtotal al subtotal.',10,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(244,'El formato corto de consulta de una dirección es Calle Número_exterior - Número_interior. Colonia.',10,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(245,'No está permitido que una dirección asignada a un grupo tenga el mismo nombre que otra previamente registrada.',10,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(246,'Es necesario que se indique al menos una dirección de un grupo para poder registrar la información del curso.',10,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(247,'Un grupo debe tener al menos una hora disponible a la semana para tomar clase.',10,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(248,'Cuando se registra el horario de un grupo, el sistema tomará omo una sola sesión aquellos bloques cuyas oras sean continuas. Si dentro de un mismo día se seleccionan dos bloques, por cada bloque se podrá elegir una dirección diferente.',10,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(249,'La dirección fiscal se podrá copiar solamente una vez a la lista de direcciones donde el grupo asistirá a clase.',3,41,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(250,'Un cliente potencial podrá ser eliminado del sistema sino ha sido asociado como cliente anteriormente.',10,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(251,'El nombre del grupo no puede ser el mismo de otro que haya sido registrado previamente en el sistema.',3,109,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(252,'El estado del grupo será Active mientras la fecha actual esté dentro del periodo descrito en el registro del grupo, en caso contrario el estado será Inactive.',10,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(253,'La prioridad de los grupos mostrados está dada en el siguiente orden:\r\n\r\n• Grupo donde ninguna de sus clases tienen un coach asignado.\r\n• Grupo donde algunas de sus clases tienen un coach asignado.\r\n• Grupo donde todas sus clases tienen un coach asignado.',10,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(254,'El promedio se calculará de la siguiente manera:\r\n\r\n• Sumar las calificaciones ingresadas en los campos: Listening, Reading, Speaking, Writing,\r\nGrammar, Vocubulary y Pronunciation.\r\n• Dividir el resultado de la suma entre 7.',10,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(255,'Para poder asignar un grupo a un coach, el coach debe de estar en estado activo.',1,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(257,'El usuario debe tener una cuenta activa y puede tener cuentas a futuro, el periodo de permiso debe respetar la siguiente ecuación en alguno de los periodos de cuenta:\r\n\r\nSea\r\n\r\n• Pc = periodo de la cuenta\r\n• Pp = periodo de permiso\r\n• fi = fecha de inicio del permiso\r\n• ff = fecha final del permiso\r\n• Fi = fecha inicial de la cuenta\r\n• Ff = fecha final de la cuenta',10,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(258,'El cambio de estado activo a estado finalizado se realizará cuando al empleado se le despide, solicita su renuncia o termina su periodo, se debe de considerar que si el empleado es un coach solo puede terminar relación laboral si no tiene sesiones asignadas que no haya impartido aún.',10,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(264,'La hora final debe ser mayor que la hora inicial.',10,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(265,'Para que un periodo se considere válido debe cumplir con las siguientes condiciones:\r\n\r\n• La fecha inicial del periodo debe ser menor que la fecha final .\r\n• No se puede registrar un periodo si se intersecta con otro periodo que se encuentre vigente.\r\n• El periodo que se desea registrar debe encontrarse dentro del periodo de contrato.',10,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(266,'La fecha inicial del periodo debe ser menor que la fecha final.',2,NULL,NULL,NULL,NULL,134,135,2,NULL,''),(268,'Un coach podrá ser asociado a un grupo cuando el periodo ingresado cumpla las ecuaciones\r\n2.4 y 2.5 que se muestran a continuación:\r\n\r\nSe definen los siguientes parámetros:\r\n\r\n• Fi es la fecha inicial del contrato.\r\n• Ff es la fecha final del contrato.\r\n• Fa es la fecha actual.\r\n• T equivale a 7 días naturales.\r\n• r equivale a 15 días naturales.',10,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(269,'Para buscar un grupo se deben seguir los siguientes criterios:\r\n\r\n• Sea P1 el periodo de contrato de un grupo.\r\n• Sea P2 el periodo de búsqueda.\r\n\r\nUn periodo de contrato P1 se define con los siguientes parámetros\r\n\r\n• Fci es la fecha inicial de contrato.\r\n• Fcf es la fecha final del contrato.\r\n\r\nUn periodo de búsqueda P2 se define con los siguientes parámetros:\r\n\r\n• Fpi es la fecha inicial del periodo.\r\n• Fpf es la fecha final del periodo.',10,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(270,'Los grupos se mostrarán con base en los siguientes criterios de ordenamiento:\r\n\r\n• Se mostrarán al principio de la lista aquellos grupos que no tengan asociado ningún coach a las sesiones programadas en el periodo especificado. El icono mostrado será de color negro.\r\n\r\n• Después se mostrarán los grupos que al menos tengan un coach asignado en alguna de las sesiones programadas en el periodo especificado y que no tengan todos los coaches asignados. El icono mostrado será de color amarillo.\r\n\r\n• Finalmente se mostrarán los grupos que en todas sus sesiones tengan un coach asignado en el periodo especificado. El icono mostrado será color verde.',10,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(271,'El estado de un grupo puede ser:\r\n\r\n• Active: El grupo estará en estado Active cuando tenga un periodo de contrato vigente, esto quiere decir que la fecha actual se encuentra dentro del rango del periodo de contrato.\r\n\r\n• Inactive: El grupo estará en estado Inactive cuando su periodo de contrato no esté vigente, esto quiere decir que la fecha actual se encuentra fuera del rango del periodo de contrato.',10,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(272,'Un Coach no puede tener registrado el mismo idioma dos veces.',3,118,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(273,'Un usuario solo puede tener una cuenta activa a la vez.',3,31,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(274,'La calificación podrá tener uno de los siguientes valores:\r\n\r\n• Numérico: valor entero entre el 0 y el 100, el cual quiere decir que es la calificación que puede obtener un alumno en los tópicos de Attend, Task y Quiz.\r\n\r\n• Caracter: la cadena permitida será N/A, indicando que el alumno no realizó la evaluación.',10,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(275,'Los Coaches deben ser mayores de 18 años.',10,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(341,'Formato para un nombre que no incluye números.',9,NULL,NULL,NULL,NULL,NULL,NULL,NULL,61,'[a-zA-Z]*');
/*!40000 ALTER TABLE `ReglaNegocio` ENABLE KEYS */;
UNLOCK TABLES;

